import React, { useState, useEffect } from 'react';
import { FolderIcon, DocumentTextIcon, MagnifyingGlassIcon, PlusIcon } from '@heroicons/react/24/outline';
import { getContracts, getContractFolders, deleteContract } from '../../../services/legalService';

const Contracts = () => {
  const [contracts, setContracts] = useState([]);
  const [folders, setFolders] = useState([]);
  const [selectedFolder, setSelectedFolder] = useState('all');
  const [searchTerm, setSearchTerm] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadContracts();
    loadFolders();
  }, []);

  const loadContracts = async () => {
    try {
      const data = await getContracts();
      setContracts(data);
    } catch (error) {
      console.error('Error loading contracts:', error);
    } finally {
      setLoading(false);
    }
  };

  const loadFolders = async () => {
    try {
      const data = await getContractFolders();
      setFolders(data);
    } catch (error) {
      console.error('Error loading folders:', error);
    }
  };

  const handleDeleteContract = async (contractId) => {
    if (window.confirm('Are you sure you want to delete this contract?')) {
      try {
        await deleteContract(contractId);
        await loadContracts(); // Reload the list
      } catch (error) {
        console.error('Error deleting contract:', error);
        alert('Error deleting contract. Please try again.');
      }
    }
  };

  const filteredContracts = contracts.filter(contract => {
    const matchesSearch = contract.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         contract.description?.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesFolder = selectedFolder === 'all' || contract.folder_name === folders.find(f => f.id === selectedFolder)?.name;
    return matchesSearch && matchesFolder;
  });

  const getStatusColor = (status) => {
    switch (status) {
      case 'active': return 'bg-green-100 text-green-800';
      case 'draft': return 'bg-yellow-100 text-yellow-800';
      case 'expired': return 'bg-red-100 text-red-800';
      case 'archived': return 'bg-gray-100 text-gray-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  if (loading) {
    return (
      <div className="space-y-8">
        <div>
          <h3 className="text-xl font-bold text-gray-900">My Contracts</h3>
          <p className="text-sm text-gray-500 mt-1">Manage your legal contracts and agreements.</p>
        </div>
        <div className="text-center py-20">
          <p className="text-gray-500">Loading contracts...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="space-y-8">
      <div>
        <h3 className="text-xl font-bold text-gray-900">My Contracts</h3>
        <p className="text-sm text-gray-500 mt-1">Manage your legal contracts and agreements.</p>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-4 gap-8">
        {/* Left Column - Folders */}
        <div className="md:col-span-1">
          <div className="bg-white p-4 rounded-lg shadow border border-gray-200">
            <h4 className="text-sm font-semibold text-gray-700 mb-4">Folders</h4>
            <div className="space-y-2">
              <button
                onClick={() => setSelectedFolder('all')}
                className={`w-full flex items-center p-2 text-left text-sm rounded-md transition-colors ${
                  selectedFolder === 'all'
                    ? 'bg-blue-100 text-blue-700'
                    : 'text-gray-700 hover:bg-gray-100'
                }`}
              >
                <FolderIcon className="h-4 w-4 mr-2" />
                All Contracts
              </button>
              {folders.map(folder => (
                <button
                  key={folder.id}
                  onClick={() => setSelectedFolder(folder.id)}
                  className={`w-full flex items-center p-2 text-left text-sm rounded-md transition-colors ${
                    selectedFolder === folder.id
                      ? 'bg-blue-100 text-blue-700'
                      : 'text-gray-700 hover:bg-gray-100'
                  }`}
                >
                  <FolderIcon className="h-4 w-4 mr-2" />
                  {folder.name}
                </button>
              ))}
            </div>
          </div>
        </div>

        {/* Right Column - Contracts */}
        <div className="md:col-span-3">
          <div className="bg-white rounded-lg shadow border border-gray-200">
            <div className="p-6 border-b border-gray-200">
              <div className="flex justify-between items-center">
                <div className="flex-1 relative max-w-md">
                  <MagnifyingGlassIcon className="pointer-events-none absolute top-2.5 left-3 h-5 w-5 text-gray-400" />
                  <input
                    type="text"
                    placeholder="Search contracts..."
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                    className="w-full pl-10 pr-4 py-2 border border-gray-300 rounded-md"
                  />
                </div>
                <div className="ml-4">
                  <span className="text-sm text-gray-500">
                    {filteredContracts.length} contract{filteredContracts.length !== 1 ? 's' : ''}
                  </span>
                </div>
              </div>
            </div>

            <div className="p-6">
              {filteredContracts.length === 0 ? (
                <div className="text-center py-12">
                  <DocumentTextIcon className="mx-auto h-12 w-12 text-gray-400" />
                  <h3 className="mt-2 text-sm font-medium text-gray-900">No contracts found</h3>
                  <p className="mt-1 text-sm text-gray-500">
                    {searchTerm || selectedFolder !== 'all' 
                      ? 'Try adjusting your search or folder filter.'
                      : 'Get started by creating a contract from a template.'
                    }
                  </p>
                </div>
              ) : (
                <div className="space-y-4">
                  {filteredContracts.map(contract => (
                    <div key={contract.id} className="border border-gray-200 rounded-lg p-4 hover:bg-gray-50">
                      <div className="flex justify-between items-start">
                        <div className="flex-1">
                          <div className="flex items-center space-x-3">
                            <DocumentTextIcon className="h-5 w-5 text-gray-400" />
                            <div>
                              <h4 className="text-sm font-medium text-gray-900">{contract.name}</h4>
                              {contract.description && (
                                <p className="text-sm text-gray-500 mt-1">{contract.description}</p>
                              )}
                            </div>
                          </div>

                          <div className="mt-3 flex items-center space-x-4 text-xs text-gray-500">
                            {contract.folder_name && (
                              <span className="flex items-center">
                                <FolderIcon className="h-3 w-3 mr-1" />
                                {contract.folder_name}
                              </span>
                            )}
                            {contract.template_name && (
                              <span>Template: {contract.template_name}</span>
                            )}
                            {contract.effective_date && (
                              <span>Effective: {new Date(contract.effective_date).toLocaleDateString()}</span>
                            )}
                            {contract.expiry_date && (
                              <span>Expires: {new Date(contract.expiry_date).toLocaleDateString()}</span>
                            )}
                            <span>Created: {new Date(contract.created_at).toLocaleDateString()}</span>
                          </div>
                        </div>

                        <div className="flex items-center space-x-2">
                          <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${getStatusColor(contract.status)}`}>
                            {contract.status}
                          </span>
                          <button
                            onClick={() => handleDeleteContract(contract.id)}
                            className="text-red-600 hover:text-red-800 text-sm"
                          >
                            Delete
                          </button>
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contracts;
